import React from 'react';
import styled from 'styled-components';
import { useState , useEffect } from 'react';
import bgImage from './fondo_iush.jpg'; // Ruta correcta de tu imagen
import bgbImage from './fondo_login.jpg';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';

const BackgroundImage = styled.div`
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-image: url(${bgbImage});
    background-size: cover;
    background-position: center;
    opacity: 0.4;
`;

const Container = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100vh;
    position: relative;
`;

const FormContainer = styled.div`
    width: 90%; /* Ajuste el ancho del formulario a un 90% del contenedor */
    max-width: 600px; /* Máximo ancho del formulario para pantallas grandes */
    max-height: 80vh;
    background: rgba(255, 255, 255, 0.9);
    padding: 20px;
    border-radius: 10px;
    box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
    overflow-y: auto; /* Habilita el desplazamiento vertical */
    /* Estilos responsivos */
    @media (max-width: 768px) {
        width: 95%;
    }
    @media (max-width: 480px) {
        width: 100%;
        padding: 10px;
    }
`;

const Title = styled.h1`
    text-align: center;
    font-family: 'Hint Vadodara', sans-serif;
    margin-bottom: 20px;
`;

const Form = styled.form`
    display: flex;
    flex-direction: column;
    gap: 10px;
`;

const Label = styled.label`
    font-family: 'Hint Vadodara', sans-serif;
`;

const Input = styled.input`
    padding: 10px;
    border: 1px solid #ccc;
    border-radius: 5px;
    font-family: 'Hint Vadodara', sans-serif;
    background-color: #f9f9f9; /* Color de fondo *
`;

const Select = styled.select`
    padding: 10px;
    border: 1px solid #ccc;
    border-radius: 5px;
    font-family: 'Hint Vadodara', sans-serif;
`;

const Button = styled.button`
    padding: 10px;
    background-color: #67157D;
    color: white;
    border: none;
    border-radius: 20px;
    cursor: pointer;
    font-family: 'Hint Vadodara', sans-serif;
    margin-top: 20px;
`;

const Option = styled.option`
    padding: 10px;
    border: 1px solid #ccc;
    border-radius: 20px;
    font-family: 'Hint Vadodara', sans-serif;
    background-color: #67157D; /* Color de fondo */
    width: 50%;
`;

const DatePickerContainer = styled.div`
    margin-bottom: 10px;
    width: 50%;
`;

const DatePickerLabel = styled(Label)`
    display: block;
    margin-bottom: 5px;
    font-family: 'Hint Vadodara', sans-serif;
`;

const FormPage = ({navigate}) => {
    const handleInicioClick = () => {
        navigate('home');
    };

    const [formData, setFormData] = useState({});
    const [selectedDate, setSelectedDate] = useState(null);
    const [nacionalidades, setNacionalidades] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        // Reemplaza con tu URL de entorno de Postman
        const fetchNacionalidades = async () => {
            try {
                const response = await fetch('localhost:3000/pais/obtener'); 
                const data = await response.json();
                setNacionalidades(data.data || []);
            } catch (error) {
                console.error('Error fetching nacionalidades:', error);
            } finally {
                setLoading(false);
            }
        };

        fetchNacionalidades();
        } , []);

    const handleChange = (e) => {
        const { id, value } = e.target;
            setFormData((prevData) => ({
            ...prevData,
            [id]: value,
        }));
    };

    const handleDateChange = (date) => {
        setSelectedDate(date);
        setFormData((prevData) => ({
            ...prevData,
            fecha: date,
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();

    const formattedData = {
        nombreEmprendimiento: formData.nombreEmprendedor || '',
        idSector: formData.sectorIndustria || '',
        idEmprendedor: formData.documentoIdentidad || '',
        fecha: formData.fecha ? formData.fecha.toISOString().split('T')[0] : '',
        respuestas: [
            { idPregunta: '6679e2892c652ff30f7ce53f', respuestaPregunta: formData.ideaClara === 'si' },
            { idPregunta: '6679e2a02c652ff30f7ce541', respuestaPregunta: formData.investigacionesMercado === 'si' },
            { idPregunta: '6679e2af2c652ff30f7ce543', respuestaPregunta: formData.necesidadProblema === 'si' },
            { idPregunta: '6679e2d12c652ff30f7ce545', respuestaPregunta: formData.retroalimentacionClientes === 'si' },
            { idPregunta: '6679e2e52c652ff30f7ce547', respuestaPregunta: formData.propuestaValor === 'si' },
            { idPregunta: '6679e2f92c652ff30f7ce549', respuestaPregunta: formData.planNegocios === 'si' },
            { idPregunta: '6679e30b2c652ff30f7ce54b', respuestaPregunta: formData.productosServicios === 'si' },
            { idPregunta: '6679e31f2c652ff30f7ce54d', respuestaPregunta: formData.prototipoPrueba === 'si' },
            { idPregunta: '6679e3352c652ff30f7ce54f', respuestaPregunta: formData.competenciaAnalisis === 'si' },
            { idPregunta: '6679e34a2c652ff30f7ce551', respuestaPregunta: formData.publicoObjetivo === 'si' },
            { idPregunta: '6679e3622c652ff30f7ce553', respuestaPregunta: formData.planFinanciero === 'si' },
            { idPregunta: '6679e3782c652ff30f7ce555', respuestaPregunta: formData.enElMercado === 'si' },
            { idPregunta: '6679e38e2c652ff30f7ce557', respuestaPregunta: formData.campañaMarketing === 'si' },
            { idPregunta: '6679e3a42c652ff30f7ce559', respuestaPregunta: formData.clientesUsuarios === 'si' },
            { idPregunta: '6679e3ba2c652ff30f7ce55b', respuestaPregunta: formData.canalDistribucion === 'si' },
            { idPregunta: '6679e3d02c652ff30f7ce55d', respuestaPregunta: formData.presenciaEnLinea === 'si' },
            { idPregunta: '6679e3e62c652ff30f7ce55f', respuestaPregunta: formData.estrategiasPrecios === 'si' },
            { idPregunta: '6679e3fc2c652ff30f7ce561', respuestaPregunta: formData.ingresosConstantes === 'si' },
            { idPregunta: '6679e4122c652ff30f7ce563', respuestaPregunta: formData.reinversionCrecimiento === 'si' },
            { idPregunta: '6679e4282c652ff30f7ce565', respuestaPregunta: formData.contratandoEmpleados === 'si' },
            { idPregunta: '6679e43e2c652ff30f7ce567', respuestaPregunta: formData.ampliadoGama === 'si' },
            { idPregunta: '6679e4542c652ff30f7ce569', respuestaPregunta: formData.metricasKPI === 'si' },
            { idPregunta: '6679e46a2c652ff30f7ce56b', respuestaPregunta: formData.sistemasGestion === 'si' },
            { idPregunta: '6679e4802c652ff30f7ce56d', respuestaPregunta: formData.baseClientes === 'si' },
            { idPregunta: '6679e4962c652ff30f7ce56f', respuestaPregunta: formData.puntoEquilibrio === 'si' },
            { idPregunta: '6679e4ac2c652ff30f7ce571', respuestaPregunta: formData.fidelizacionClientes === 'si' },
            { idPregunta: '6679e4c22c652ff30f7ce573', respuestaPregunta: formData.procesosEstandarizados === 'si' },
            { idPregunta: '6679e4d82c652ff30f7ce575', respuestaPregunta: formData.analisisRendimiento === 'si' },
            { idPregunta: '6679e4ee2c652ff30f7ce577', respuestaPregunta: formData.costosControlados === 'si' },
            { idPregunta: '6679e5042c652ff30f7ce579', respuestaPregunta: formData.satisfaccionCliente === 'si' },
            { idPregunta: '6679e51a2c652ff30f7ce57b', respuestaPregunta: formData.equipoMotivado === 'si' },
            { idPregunta: '6679e5302c652ff30f7ce57d', respuestaPregunta: formData.beneficiosConstantes === 'si' },
            { idPregunta: '6679e5462c652ff30f7ce57f', respuestaPregunta: formData.mejorasContinuas === 'si' },
            { idPregunta: '6679e55c2c652ff30f7ce581', respuestaPregunta: formData.expansionMercados === 'si' },
            { idPregunta: '6679e5722c652ff30f7ce583', respuestaPregunta: formData.sociosEstrategicos === 'si' },
            { idPregunta: '6679e5882c652ff30f7ce585', respuestaPregunta: formData.financiamientoExterno === 'si' },
            { idPregunta: '6679e59e2c652ff30f7ce587', respuestaPregunta: formData.planExpansion === 'si' },
            { idPregunta: '6679e5b42c652ff30f7ce589', respuestaPregunta: formData.patentesMarcas === 'si' },
            { idPregunta: '6679e5ca2c652ff30f7ce58b', respuestaPregunta: formData.estrategiaSalida === 'si' },
        ] 
    };

        console.log(formattedData);
    // Aquí puedes envio del JSON al servidor
    };


    return (
    <div>
        <BackgroundImage />
        <Container>

        <FormContainer>
            <Title>Registro de emprendimientos</Title>
            <Form onSubmit={handleSubmit}>
                <Label>Nombre del emprendedor</Label>
                <Input id="nombreEmprendedor" type="text" placeholder="Ingresa tu nombre" value={formData.nombreEmprendedor || ''} onChange={handleChange} required />

                <Label>Nacionalidad</Label>
                    {loading ? (
                    <p>Cargando nacionalidades...</p>
            ) : (
                    <Select id="nacionalidad" value={formData.nacionalidad || ''} onChange={handleChange} required >
                        <Option value="">Selecciona una nacionalidad</Option>
                        {nacionalidades.map((nac) => (
                        <Option key={nac._id} value={nac.nombre}> {nac.nombre}, {nac.descripcion} </Option>
                ))}
                    </Select>
            )}

                <Label>Ciudad de residencia</Label>
                <Input id="ciudadResidencia" type="text" placeholder="Ingresa tu ciudad de residencia" value={formData.ciudadResidencia || ''} onChange={handleChange} required />

                <Label>Documento de identidad</Label>
                <Input id="documentoIdentidad" type="text" placeholder="Ingresa tu documento de identidad" value={formData.documentoIdentidad || ''} onChange={handleChange} required />

                <Label>Correo electrónico personal</Label>
                <Input id="correoPersonal" type="email" placeholder="Ingresa tu correo electrónico personal" value={formData.correoPersonal || ''} onChange={handleChange} required />

                <Label>Correo electrónico institucional</Label>
                <Input id="correoInstitucional" type="email" placeholder="Ingresa tu correo electrónico institucional" value={formData.correoInstitucional || ''} onChange={handleChange} required />

                <Label>Teléfono</Label>
                <Input id="telefono" type="text" placeholder="Ingresa tu teléfono" value={formData.telefono || ''} onChange={handleChange} required />

                <Label>Nombre de la institución a la que pertenece</Label>
                <Input id="nombreInstitucion" type="text" placeholder="Ingresa el nombre de la institución" value={formData.nombreInstitucion || ''} onChange={handleChange} required />

                <Label>Nombre del emprendimiento</Label>
                <Input id="nombreEmprendimiento" type="text" placeholder="Ingresa el nombre" value={formData.nombreEmprendimiento || ''} onChange={handleChange} required />

                <Label>Programa académico al que pertenece</Label>
                <Select id="programaAcademico" value={formData.programaAcademico || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="programa1">Programa 1</Option>
                    <Option value="programa2">Programa 2</Option>
                    <Option value="programa3">Programa 3</Option>
                    <Option value="programa4">Programa 4</Option>
                </Select>

                <Label>Fecha de creación del emprendimiento</Label>
                    <DatePickerContainer>
                        <DatePickerLabel htmlFor="fecha">Selecciona una fecha</DatePickerLabel>
                        <DatePicker id="fecha" selected={selectedDate} onChange={handleDateChange} dateFormat="yyyy-MM-dd" placeholderText="Selecciona una fecha" showMonthDropdown showYearDropdown dropdownMode="select" />
                    </DatePickerContainer>

                <Label>Sector o industria del emprendimiento</Label>
                <Select id="sectorIndustria" value={formData.sectorIndustria || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="tecnologia">Tecnología</Option>
                    <Option value="salud_bienestar">Salud y Bienestar</Option>
                    <Option value="educacion">Educación</Option>
                    <Option value="alimentos_bebidas">Alimentos y Bebidas</Option>
                    <Option value="moda_belleza">Moda y Belleza</Option>
                    <Option value="energia_medio_ambiente">Energía y Medio Ambiente</Option>
                    <Option value="fintech">Fintech</Option>
                    <Option value="turismo_hospitalidad">Turismo y Hospitalidad</Option>
                    <Option value="construccion_inmobiliaria">Construcción e Inmobiliaria</Option>
                </Select>

                <Label>¿Tienes una idea clara y definida de tu emprendimiento?</Label>
                <Select id="ideaClara" value={formData.ideaClara || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Has realizado investigaciones de mercado para validar tu idea?</Label>
                <Select id="investigacionesMercado" value={formData.investigacionesMercado || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Has identificado una necesidad o problema específico que tu idea busca resolver?</Label>
                <Select id="necesidadProblema" value={formData.necesidadProblema || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Has recibido retroalimentación de posibles clientes sobre tu idea?</Label>
                <Select id="retroalimentacionClientes" value={formData.retroalimentacionClientes || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Tienes una propuesta de valor única para tu producto/servicio?</Label>
                <Select id="propuestaValor" value={formData.propuestaValor || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Tienes un plan de negocios formal y detallado?</Label>
                <Select id="planNegocios" value={formData.planNegocios || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Has definido tus productos o servicios específicos?</Label>
                <Select id="productosServicios" value={formData.productosServicios || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Has realizado algún prototipo (versión preliminar del producto o servicio a ofrecer) o prueba piloto de tu producto/servicio?</Label>
                <Select id="prototipoPrueba" value={formData.prototipoPrueba || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Has identificado a tu competencia y analizado sus fortalezas y debilidades?</Label>
                <Select id="competenciaAnalisis" value={formData.competenciaAnalisis || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Tienes identificado tu público objetivo?</Label>
                <Select id="publicoObjetivo" value={formData.publicoObjetivo || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Has elaborado un plan financiero y de costos?</Label>
                <Select id="planFinanciero" value={formData.planFinanciero || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Tu emprendimiento ya está en el mercado?</Label>
                <Select id="enElMercado" value={formData.enElMercado || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Has realizado alguna campaña de marketing o promoción?</Label>
                <Select id="campañaMarketing" value={formData.campañaMarketing || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Tienes clientes o usuarios que ya han adquirido tus productos/servicios?</Label>
                <Select id="clientesUsuarios" value={formData.clientesUsuarios || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Tienes un canal de distribución definido?</Label>
                <Select id="canalDistribucion" value={formData.canalDistribucion || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Tu emprendimiento tiene una presencia en línea (sitio web, redes sociales)?</Label>
                <Select id="presenciaEnLinea" value={formData.presenciaEnLinea || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Has definido tus estrategias de precios?</Label>
                <Select id="estrategiasPrecios" value={formData.estrategiasPrecios || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Tu emprendimiento ha empezado a generar ingresos constantes?</Label>
                <Select id="ingresosConstantes" value={formData.ingresosConstantes || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Estás reinvirtiendo en el crecimiento del negocio?</Label>
                <Select id="reinversionCrecimiento" value={formData.reinversionCrecimiento || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Estás contratando empleados o colaboradores?</Label>
                <Select id="contratandoEmpleados" value={formData.contratandoEmpleados || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Has ampliado tu gama de productos/servicios desde el lanzamiento?</Label>
                <Select id="ampliadoGama" value={formData.ampliadoGama || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Tienes métricas y KPIs definidos para medir el rendimiento de tu negocio?</Label>
                <Select id="metricasKPI" value={formData.metricasKPI || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Has implementado sistemas de gestión y operación para mejorar la eficiencia?</Label>
                <Select id="sistemasGestion" value={formData.sistemasGestion || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Tu negocio ya tiene una base de clientes establecida?</Label>
                <Select id="baseClientes" value={formData.baseClientes || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Has alcanzado un punto de equilibrio financiero?</Label>
                <Select id="puntoEquilibrio" value={formData.puntoEquilibrio || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Estás trabajando en la fidelización de tus clientes?</Label>
                <Select id="fidelizacionClientes" value={formData.fidelizacionClientes || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Tienes procesos operativos estandarizados?</Label>
                <Select id="procesosEstandarizados" value={formData.procesosEstandarizados || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Realizas análisis regulares del rendimiento del negocio y ajustas tus estrategias en consecuencia?</Label>
                <Select id="analisisRendimiento" value={formData.analisisRendimiento || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Tu negocio opera de manera eficiente con costos controlados?</Label>
                <Select id="costosControlados" value={formData.costosControlados || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Tu negocio tiene una alta satisfacción del cliente?</Label>
                <Select id="satisfaccionCliente" value={formData.satisfaccionCliente || ''} onChange={handleChange} required>
                    <Option value="">Seleccionar</Option>
                    <Option value="si">Sí</Option>
                    <Option value="no">No</Option>
                </Select>

                <Label>¿Tienes un equipo de trabajo bien establecido y motivado?</Label>
                <Select id="equipoMotivado" value={formData.equipoMotivado || ''} onChange={handleChange} required>
